double prob_no_attn = 1;
int weight_no_attn = 1;

void update_attn_prob(){
    prob_attn =(time / MAX_Time) * c_value + c;
    weight_attn = fint(prob_attn  * 100) ;
    prob_no_attn = 1 - prob_attn;
    weight_no_attn = fint(prob_no_attn  * 100);
}

